import styled from "styled-components/native";
import { LinearGradient } from "expo-linear-gradient";
export const Container = styled.View`
  background: #eee;
  flex: 1;
`;

export const Header = styled(LinearGradient).attrs({
  colors: ["#00fc6c", "#00ac4a"]
})`
  height: 300px;
`;
